import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";

class Contact extends Component {
  render() {
    return (
      <div className="contact-body">
        <Grid className="contact-grid">
          <Cell col={6}>
            <h2> Trasporti Amatrudo srl </h2>
            <img src="" alt="tasrl" />
            style={{ height: "200px" }}
          </Cell>
          <Cell col={6}>H</Cell>
        </Grid>
      </div>
    );
  }
}

export default Contact;
